func UnmarshalMessageInput(v interface{}) (MessageInput, error) {
	var it MessageInput
	var asMap = v.(map[string]interface{})

	for k, v := range asMap {
		switch k {
		case "header":
			var err error
			var ptr1 string
			if v != nil {
				ptr1, err = graphql.UnmarshalString(v)
				it.Header = &ptr1
			}

			if err != nil {
				return it, err
			}
		case "value":
			var err error
			var ptr1 string
			if v != nil {
				ptr1, err = graphql.UnmarshalString(v)
				it.Value = &ptr1
			}

			if err != nil {
				return it, err
			}
		}
	}

	return it, nil
}

func (ec *executionContext) FieldMiddleware(ctx context.Context, obj interface{}, next graphql.Resolver) (ret interface{}) {
	defer func() {
		if r := recover(); r != nil {
			ec.Error(ctx, ec.Recover(ctx, r))
			ret = nil
		}
	}()
	res, err := ec.ResolverMiddleware(ctx, next)
	if err != nil {
		ec.Error(ctx, err)
		return nil
	}
	return res
}

func (ec *executionContext) introspectSchema() *introspection.Schema {
	return introspection.WrapSchema(parsedSchema)
}

func (ec *executionContext) introspectType(name string) *introspection.Type {
	return introspection.WrapTypeFromDef(parsedSchema, parsedSchema.Types[name])
}

var parsedSchema = gqlparser.MustLoadSchema(
	&ast.Source{Name: "schema.graphql", Input: `type Query {
  # Returns a slice of the stream.
  read(
    # The name of the stream to read. (eq: "order-123")
    name: String!, 
    # The earliest message to read (inclusive).
    from: Int!,
    # The maximum number of messages to read. The actual slice might 
    # be smaller than this count.
    maxCount: Int, 
    # The direction to read. If omitted the direction is FORWARD.
    direction: Direction): Slice
}

enum Direction{
  FORWARD
  BACKWARD
}

type AppendResult{
  # The position of the first message appended to the stream.
  from: Int!
}

type Mutation {
  append(id: String!, messages: [MessageInput!]!): AppendResult
}

type Slice {
  stream: String!
  from: Int!
  count: Int!
  messages: [Message!]
  direction: Direction!
}

input MessageInput{
  header: String
  value: String
}

type Message{
  streamId: String!
  header: String!
  value: String!
}

`},
)
